import { useState, useEffect } from 'react'
import { useLocation } from "react-router-dom"
import { useNavigate } from "react-router-dom"

const AdminViewMenu = () => {

    const {state} = useLocation()
    const [menuItems, setMenuItems] = useState([])
    const navigate = useNavigate()

    const fecthMenuItems = async() => {
        const res = await fetch(`http://localhost8080/foodpanda/food/view/${state.restaurant.name}`)
        const data = await res.json()
        console.log(data)
        return data
    }

    useEffect(() =>{
        const getMenuItems = async() => {
            const menuItemsLocal = await fecthMenuItems()
            setMenuItems(menuItemsLocal)
        }
        getMenuItems()       
    },[])

    console.log(menuItems)

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }
    return(
        <div className = "row">
        <div style={{color: '#800040', marginLeft : 50, fontSize : 50}}>FoodPanda</div>
        <button className = "btn" style = {{marginLeft : 1000}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
            Log out
        </button>
        </div>

    )

}

export default AdminViewMenu
